INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24001, 401, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 2, 102301, 0.0, 24, "アヤネ", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24002, 402, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 1, 102301, 2.21, 24, "アヤネ", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24003, 403, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 2, 102301, 0.0, 24, "アヤネ", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24004, 701, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", 2, 192201, 1.99, 24, "アサヒ", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24005, 702, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 1, 192201, 2.21, 24, "アサヒ", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24006, 703, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", 2, 192201, 3.33, 24, "アサヒ", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24007, 801, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 2, 192301, 0.0, 24, "部員３", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24008, 802, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 1, 192301, 2.68, 24, "部員３", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24009, 803, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 2, 192301, 0.0, 24, "部員３", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24010, 501, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", 1, 192501, 0.0, 24, "", "やった！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24011, 502, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", 1, 192501, 0.0, 24, "", "勝ったよ！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24012, 503, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", 1, 192501, 0.0, 24, "", "いい調子！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24013, 111, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 6, 113501, 5.33, 24, "ミサト", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24014, 112, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 1, 113501, 6.85, 24, "ミサト", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24015, 113, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 1, 113501, 3.0, 24, "ミサト", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24016, 611, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 1, 192401, 6.11, 24, "ダイチ", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24017, 612, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 1, 192401, 6.75, 24, "ダイチ", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24018, 613, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 2, 192401, 0.0, 24, "ダイチ", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24019, 211, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", 2, 113401, 4.52, 24, "ハツネ", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24020, 212, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", 2, 113401, 3.89, 24, "ハツネ", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24021, 213, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 1, 113401, 13.49, 24, "ハツネ", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24022, 311, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 1, 106501, 3.17, 24, "カヤ", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24023, 312, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 1, 106501, 4.42, 24, "カヤ", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24024, 313, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", 6, 106501, 2.89, 24, "カヤ", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24025, 421, "2030/12/17 14:59:59", 0.0, 3, "2020/07/31 12:00:00", 4, 102301, 3.71, 24, "アヤネ", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24026, 721, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", 2, 192201, 5.1, 24, "アサヒ", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24027, 821, "2030/12/17 14:59:59", 0.0, 3, "2020/07/31 12:00:00", 1, 192301, 4.34, 24, "部員３", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24028, 521, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", 1, 192501, 0.0, 24, "", "いい勝負だったよ\nまたやろうね", 0.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24029, 101, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 1, 113501, 5.62, 24, "ミサト", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", -360.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24030, 102, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 1, 113501, 9.58, 24, "ミサト", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", -360.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24031, 103, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 2, 113501, 0.0, 24, "ミサト", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", -360.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24032, 104, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", 2, 113501, 9.13, 24, "ミサト", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", -360.0, 10046);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (24033, 105, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 1, 113501, 8.27, 24, "ミサト", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", -360.0, 10046);
